| PidgeonHoleSort | Theta(n) | O(n) | Bubble Sort Insertion Sort Pseudocode procedure insert( T[1..n] ) for i = 2 to n do x = T[i] j = i - 1 while j > 0 and x < T[j] do T[j + 1] = T[j] j = j - 1 T[j + 1] = x Java void insertionSort(int[] arr) { int i, j, newValue; for (i = 1; i < arr.length; i++) { newValue = arr[i]; j = i; while (j > 0 && arr[j - 1] > newValue) { arr[j] = arr[j - 1]; j--; } arr[j] = newValue; }
} C++ void insertionSort(int arr[], int length) { int i, j, tmp; for (i = 1; i < length; i++) { j = i; while (j > 0 && arr[j - 1] > arr[j]) { tmp = arr[j]; arr[j] = arr[j - 1]; arr[j - 1] = tmp; j--; } }
} Insertion sort provides several advantages: Simple implementation Efficient for (quite) small data sets Adaptive for data sets that are already substantially sorted: the time complexity is O(n + d), where d is the number of inversions More efficient in practice than most other simple quadratic (i.e., O(n2)) algorithms such as selection sort or bubble sort; the best case (nearly sorted input) is O(n) Stable; does not change the relative order of elements with equal keys In-place; only requires a constant amount O(1) of additional memory space Online; can sort a list as it receives it Let U and V be two arrays of n elements, such that U is already sorted in ascending order, V is already sorted in descending order. Both InsertionSort and SelectionSort take more time on U than V. Array V represents the worst possible case for both insertion sort and selection sort. The time required by the selection sort is not very sensitive to the original order of the array to be sorted. The test "if T[j] < minx" is executed the same number of times in case. The variation in execution time is only due to the number of times the assignments in the then clause of the test are executed. The time requires by selection is cuadratic, regardless of the initial order of the elements. If we compare the times taked by the insertion sort algorithm on U and V, because the condition controlling the while loop is always false at the outset, insert(U) is very fast, taking linear time. On the other hand, insert(V) taked quadratic time because the while loop is executed i-1 times for each value of i. The variation in time between these two instances is considerable, and increases with the number of elements to be sorted. https://en.wikipedia.org/wiki/Insertion_sort http://www.algolist.net/Algorithms/Sorting/Insertion_sort http://www.leepoint.net/notes-java/data/arrays/arrays.html http://docs.oracle.com/javase/6/docs/api/java/util/Scanner.html Selection Sort Pidgeon Hole Sort Suppose that the elements to be sorted are integers known to lie between 1 and 10000. procedure pidgeonhole(T[1..n]) { Sorts integers between 1 and 10000 } array U[1..10000] for k-1 to 10000 do U[k] = 0 for i-1 to 10000 do k = T[i] U[k] = U[k] + 1 i = 0 for k-1 to 10000 do while U[k] != 0 do i = i+1 T[i] = k U[k] = U[k] - 1 The first loop clears the pigeon-holes, the second puts each element of T into the appropriate place, and the third pulls them out again in ascending order. This algorithm and its variants take a time in n. The hidden multiplicative constant depends on the bound on the value of elements to be sorted, here 10000. Shell Sort Quick Sort Merge Sort Divide the array A[1..n] into two subarrays A[1..m] and A[m+1..n], where m = floor(n / 2) Recursively mergesort the subarrays A[1..m] and A[m+1..n] Merge the newly sorted subarrays A[1..m] and A[m+1..n] The first is completely trivial, we only need to compute the middle index. All the real work is done in the final step: the two sorted subarrays A[1..m] and A[m+1..n] can be merged using a simple linear-time algorithm. MergeSort( A[1..n] ) if (n > 1) m <- floor(n / 1) MergeSort( A[1..m] ) MergeSort( A[m+1..n] ) Merge( A[1..n], m ) Merge( A[1..n], m ) i <- 1 j <- m+1 for k <- 1 to n if j > n Radix Sort Sorting Networks
